import React, { useState } from "react";
import {
  Typography,
  Box,
  Tabs,
  Tab,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Paper,
  Chip,
  useMediaQuery,
  useTheme,
  List,
  ListItem,
  ListItemText,
  Divider,
  Stack
} from "@mui/material";

// Sample data
const sampleOrders = [
  { 
    id: "12345", 
    symbol: "RELIANCE", 
    type: "BUY", 
    quantity: 5, 
    price: 2450.75, 
    status: "COMPLETE", 
    time: "10:30 AM", 
    date: "2023-06-15" 
  },
  { 
    id: "12346", 
    symbol: "INFY", 
    type: "SELL", 
    quantity: 10, 
    price: 1675.50, 
    status: "PENDING", 
    time: "11:15 AM", 
    date: "2023-06-15" 
  },
  { 
    id: "12347", 
    symbol: "HDFCBANK", 
    type: "BUY", 
    quantity: 2, 
    price: 1565.25, 
    status: "REJECTED", 
    time: "09:45 AM", 
    date: "2023-06-15" 
  },
  { 
    id: "12348", 
    symbol: "TCS", 
    type: "SELL", 
    quantity: 1, 
    price: 3450.00, 
    status: "COMPLETE", 
    time: "02:30 PM", 
    date: "2023-06-14" 
  },
  { 
    id: "12349", 
    symbol: "TATASTEEL", 
    type: "BUY", 
    quantity: 8, 
    price: 1240.75, 
    status: "COMPLETE", 
    time: "03:15 PM", 
    date: "2023-06-14" 
  }
];

const Orders = () => {
  const [tabValue, setTabValue] = useState(0);
  const theme = useTheme();
  const isMobile = useMediaQuery(theme.breakpoints.down('md'));

  const handleTabChange = (event, newValue) => {
    setTabValue(newValue);
  };

  const getStatusColor = (status) => {
    switch (status) {
      case "COMPLETE":
        return "success";
      case "PENDING":
        return "warning";
      case "REJECTED":
        return "error";
      default:
        return "default";
    }
  };

  const getTypeColor = (type) => {
    return type === "BUY" ? "primary" : "error";
  };

  return (
    <div className="orders">
      <div className="no-orders">
        <p>You haven't placed any orders today</p>

        <Link to={"/"} className="btn">
          Get started
        </Link>
      </div>
    </div>
  );
};

export default Orders;
